    void Awake()
    {
        for (int i = 0; i < stageArray.GetLength(0); i++)
        {
            for (int j = 0; j < stageArray.GetLength(1); j++)
            {
                if (stageArray[i, j] == 1)
                {
                    Instantiate(floorBlock, new Vector3(j, i, 0), Quaternion.identity,block);
                }

                if (stageArray[i, j] == 5)
                {
                    Instantiate(Player, new Vector3(j, i, 0), Quaternion.identity);
                }

                if (stageArray[i, j] == 6)
                {
                    Instantiate(Enemy[0], new Vector3(j, i + EnemyY[0], 0), Quaternion.identity, EnemyList[0]);                  

                }
                if (stageArray[i, j] == 7)
                {
                    Instantiate(Enemy[1], new Vector3(j, i + EnemyY[1], 0), Quaternion.identity, EnemyList[0]);

                }
                if (stageArray[i, j] == 8)
                {
                    Instantiate(Enemy[2], new Vector3(j, i + EnemyY[2], 0), Quaternion.identity, EnemyList[0]);

                }

                if (stageArray[i, j] == 9)
                {
                    Instantiate(Enemy[3], new Vector3(j, i + EnemyY[3], 0), Quaternion.identity);
                }

                if (stageArray[i, j] == 10)
                {
                    Instantiate(Enemy[4], new Vector3(j, i + EnemyY[4], 0), Quaternion.identity);
                }
            }
        }

        //-----------二次元配列からプレイヤーの位置取得--------
        for (int i = 0; i < stageArray.GetLength(0); i++)
        {
            for (int j = 0; j < stageArray.GetLength(1); j++)
            {
                if (stageArray[i, j] == 5)
                {
                    PlayerPositionX = j;
                    PlayerPositionY = i;
                }
            }
        }
    }

    void Start()
    {
        Player = GameObject.FindGameObjectWithTag("Player");

        EnemyNormal = GameObject.FindGameObjectsWithTag("Normal");
        EnemySoft = GameObject.FindGameObjectsWithTag("Soft");
        EnemyHard = GameObject.FindGameObjectsWithTag("Hard");

        for (int i = 0; i < EnemyNormal.Length; i++)
        {
            EnemyDefaultPos[i] = EnemyNormal[i].transform.position;                      
        }

        for (int i = 0; i < EnemySoft.Length; i++)
        {
            EnemyDefaultPos[i] = EnemySoft[i].transform.position;
        }

        for (int i = 0; i < EnemyHard.Length; i++)
        {
            EnemyDefaultPos[i] = EnemyHard[i].transform.position;
        }

    }

